INSERT INTO `confession_comment` VALUES
(1,124,'1','I think Nepal should stay a republic, but in the current age, it is not possible, as there is no security regarding whether the king will bring the development we need or not, in my opinion.','2025-04-16 21:15:34','Demos Shrestha'),
(2,125,'1','\"I believe Nepal should not have a king. Instead, the country should focus on finding a visionary leader who can lead its development. I understand why some people support the idea of a monarchy, especially given the government\'s poor performance, but bringing back a king is not the answer. What Nepal truly needs is strong and forward-thinking leadership.\"','2025-04-16 22:44:18','Rhythm Chhetri'),
(3,126,'1','In my opinion, bringing the king back would be a powerful symbol of unity and tradition. While times have changed, the presence of a monarch could restore a sense of national identity and pride. It’s not just about power—it’s about history, culture, and a figure who stands above politics. A modern monarchy could play a meaningful, ceremonial role while helping to reconnect people with their heritage.','2025-04-16 22:54:40','TRijan Shakya'),
(4,129,'1','As said by Voltaire , \"With great power comes great responsibility\" ; whether it\'s monarchy or democracy , a person who holds the power should work responsibly and ethically. I believe that if the monarchy system does return, the power would likely be misused and the development we expect will just be our dreams. I also strongly believe that it is not the ruling system we need to change but the people in our democratic government. Similarly it\'s not only the leaders but also the citizens of the nation who should understand the consequences they will have to face for every action they take.','2025-04-17 17:13:32','Smile '),
(5,134,'1','It is quite an argumentative topic. In some way bringing monarchy back does seem to be a good but that doesn\'t mean it will work. So instead it\'s better to focus on how to make the existing system much stronger rather than battling to bring back the king. ','2025-04-28 22:53:49','Srija'),
(6,133,'5','As a Nepali citizen, I admire Balen Shah for his bold steps and honesty as Mayor of Kathmandu. He’s inspired many youths and shown that change is possible. But leading a nation is much more complex than managing a city. It needs experience in national governance, diplomacy, and dealing with diverse issues across the country. While Balen has potential and fresh ideas, he still needs time and exposure to national politics. I believe he could become a strong leader in the future, but right now, Nepal needs someone with both vision and proven experience to lead at the national level.','2025-05-01 21:56:20','Saira');
