INSERT INTO `confessions` VALUES
(1,'What if king is back in Nepal?','what-if-king-is-back-in-nepal','Anonymous','<p class=\"\" data-start=\"181\" data-end=\"367\">Lately, more youth are questioning if democracy is really working for Nepal. With political instability and corruption, some believe a return to monarchy could bring unity and stability.</p>\r\n<p class=\"\" data-start=\"369\" data-end=\"408\">&nbsp;What if the king came back tomorrow?</p>\r\n<ul data-start=\"410\" data-end=\"541\">\r\n<li class=\"\" data-start=\"410\" data-end=\"450\">\r\n<p class=\"\" data-start=\"412\" data-end=\"450\">Would Nepal progress or fall behind?</p>\r\n</li>\r\n<li class=\"\" data-start=\"451\" data-end=\"506\">\r\n<p class=\"\" data-start=\"453\" data-end=\"506\">Would a symbolic king (like in the UK) work better?</p>\r\n</li>\r\n<li class=\"\" data-start=\"507\" data-end=\"541\">\r\n<p class=\"\" data-start=\"509\" data-end=\"541\">Or is monarchy an outdated idea?</p>\r\n</li>\r\n</ul>\r\n<p class=\"\" data-start=\"543\" data-end=\"597\">&nbsp;Should Nepal stay a republic, or hold a referendum?</p>\r\n<p class=\"\" data-start=\"599\" data-end=\"661\">Drop your thoughts below &mdash; let&rsquo;s have a respectful debate&nbsp;</p>','king,monarchy,democracy','https://nepstate.com/resources/uploads/classified-listing/b0ac64d8a3dc3926c72566e8049ed053.jpg','2025-04-16 20:31:05',1,109,0,'forum',0,5,1,NULL),
(2,'Fitness & Training Tips for Athletes in Nepal','fitness--training-tips-for-athletes-in-nepal','Anonymous','<p class=\"\" data-start=\"116\" data-end=\"187\">Training in Nepal can be challenging without fancy gyms or equipment.</p>\r\n<p class=\"\" data-start=\"194\" data-end=\"319\">???? What&rsquo;s your workout routine?<br data-start=\"225\" data-end=\"228\">???? Do you use protein or natural alternatives?<br data-start=\"276\" data-end=\"279\">???? Tips for staying fit on a budget?</p>\r\n<p class=\"\" data-start=\"326\" data-end=\"421\">Share your advice, routines, and tricks &mdash; let&rsquo;s build a stronger fitness community together!</p>','fitness,sports,nepal','https://nepstate.com/resources/uploads/classified-listing/d9f273b61824673da1bae3adce74f81f.png','2025-04-16 20:21:04',1,109,0,'forum',0,6,1,NULL),
(3,'Share Your Experience: U.S. Student Visa Journey for Nepali Students','share-your-experience-us-student-visa-journey-for-nepali-students','Anonymous','<p class=\"\" data-start=\"127\" data-end=\"261\">Applying for a U.S. student visa can be a stressful process, but hearing from others who&rsquo;ve been through it can make it a lot easier.</p>\r\n<p class=\"\" data-start=\"263\" data-end=\"490\">Share your story: How was your F1 visa application process? What challenges did you face during your visa interview? Any tips for future applicants to make the process smoother? What was the most surprising part of the journey?</p>\r\n<p class=\"\" data-start=\"492\" data-end=\"657\">Whether you&rsquo;ve just started applying or you&rsquo;ve already arrived in the U.S., your experience can help someone else make the process easier. Let&rsquo;s support each other.</p>','usa,visa,f1visa','https://nepstate.com/resources/uploads/classified-listing/b53789ded9dee36c58a810bd29174326.jpg','2025-04-16 20:27:21',1,109,0,'forum',0,4,1,NULL),
(4,'Confession','confession','Anonymous','<p class=\"\" data-start=\"130\" data-end=\"372\">Moving to the USA changed more than just my location &mdash; it changed my entire mindset. Back in Nepal, life felt simpler, slower. We lived more in the moment, but we were also stuck in a comfort zone without even realizing it.</p>\r\n<p class=\"\" data-start=\"374\" data-end=\"664\">Here in the U.S., I&rsquo;ve learned what it means to truly hustle. People think differently &mdash; it&rsquo;s about productivity, growth, and constantly pushing yourself. It&rsquo;s competitive, yes, but it also teaches you to think big, to plan ahead, to believe that you can actually build the life you want.</p>\r\n<p class=\"\" data-start=\"666\" data-end=\"894\">It&rsquo;s not easy. Some days I miss the peaceful mornings in Nepal, the spontaneous hangouts, the warmth of community. But the mindset I&rsquo;ve developed here &mdash; independence, ambition, self-belief &mdash; is something I never want to lose.</p>','usa,nepaliabroadlifeinusa',NULL,'2025-04-18 18:35:58',1,109,0,'confession',0,0,1,NULL),
(5,'Is Balen Shah a Good Future Prime Minister for Nepal?','is-balen-shah-a-good-future-prime-minister-for-nepal','Anonymous','<p class=\"\" data-start=\"129\" data-end=\"315\">Balen Shah has earned a lot of support, especially from the youth, for his work as Mayor of Kathmandu. Many see him as a fresh and honest leader in a political system that feels stuck.</p>\r\n<p class=\"\" data-start=\"317\" data-end=\"510\">But would he make a good Prime Minister for the whole country? Does he have the experience, vision, and leadership skills Nepal needs? Or is leading a city very different from leading a nation?</p>\r\n<p class=\"\" data-start=\"512\" data-end=\"597\">What do you think? Share your honest opinions and let\'s have a respectful discussion.</p>','#balenshah,#futurepm,#nepalelection','https://nepstate.com/resources/uploads/classified-listing/7a67957fbe849d23cb21ee1ced9b609c.jpg','2025-04-28 20:47:02',1,109,0,'forum',0,5,1,NULL),
(6,'Back in Nepal','back-in-nepal','Anonymous','<p class=\"\" data-start=\"359\" data-end=\"575\">Back in Nepal, life was too easy &mdash; I never even stepped inside the kitchen unless it was to grab a plate of hot food mom had already made. Cooking? Cleaning? Worrying about groceries? It never even crossed my mind.</p>\r\n<p class=\"\" data-start=\"577\" data-end=\"920\">Fast forward to now &mdash; living alone in the USA &mdash; I\'m the guy standing in the kitchen Googling &ldquo;how to boil rice&rdquo; and burning my first attempt at making dal. Washing my own clothes, figuring out bills, working late nights, and eating whatever I can put together... this wasn&rsquo;t part of the dream we imagined when we talked about &ldquo;going abroad.&rdquo;</p>\r\n<p class=\"\" data-start=\"922\" data-end=\"1174\">I miss the carefree days. Riding my scooter around Kathmandu with friends, no real stress except what to eat for lunch. Now, calling those same friends once a week feels like a luxury. Schedules, time zones, responsibilities &mdash; they&rsquo;ve all changed us.</p>','nepal,olddays,friends',NULL,'2025-04-28 21:00:17',1,133,0,'confession',0,0,1,NULL);
