p;<strong>Charlotte &ndash; June 2, 2025<\\/strong><\\/h3>\\r\\n<ul>\\r\\n<li>\\r\\n<p><strong>Venue:<\\/strong>&nbsp;<strong><span class=\\\"xn-location\\\">CHARLOTTE, NC<\\/span>&nbsp;(<span class=\\\"xn-chron\\\">6-8 PM<\\/span>)<br class=\\\"dnr\\\"><\\/strong>UNCC Charlotte<br class=\\\"dnr\\\">9119 University Rd,&nbsp;<span class=\\\"xn-location\\\">Charlotte, NC<\\/span><br class=\\\"dnr\\\"><a href=\\\"https:\\/\\/c212.net\\/c\\/link\\/?t=0&amp;l=en&amp;o=4426656-1&amp;h=1409504486&amp;u=https%3A%2F%2Ftinyurl.com%2FDrRuitInCharlotte&amp;a=https%3A%2F%2Ftinyurl.com%2FDrRuitInCharlotte\\\" target=\\\"_blank\\\" rel=\\\"nofollow noopener\\\">https:\\/\\/tinyurl.com\\/DrRuitInCharlotte<\\/a><\\/p>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p><strong>Time:<\\/strong>&nbsp;6:00 PM &ndash; 8:00 PM<\\/p>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<hr>\\r\\n<p><strong>The Impact of Tilganga\'s IOL Laboratory<br class=\\\"dnr\\\"><\\/strong>Since its establishment in 1994, Tilganga\'s IOL lab has accomplished extraordinary milestones:<\\/p>\\r\\n<ul type=\\\"disc\\\">\\r\\n<li>Production of over 6.5 million lenses distributed to more than 40 countries across&nbsp;<span class=\\\"xn-location\\\">Asia<\\/span>,&nbsp;<span class=\\\"xn-location\\\">Africa<\\/span>, and&nbsp;<span class=\\\"xn-location\\\">South America<\\/span>, significantly benefiting marginalized communities.<\\/li>\\r\\n<li>Annual production of 300,000 lenses, helping to meet the growing demand for affordable eye care.<\\/li>\\r\\n<li>Achieving ISO certification and CE marking, ensuring compliance with global safety and quality standards.<\\/li>\\r\\n<li>Supporting high-volume cataract surgery campaigns in remote areas, restoring sight to thousands within days.<\\/li>\\r\\n<\\/ul>\\r\\n<p><strong>Expanding for the Future: The Hetauda Project<br class=\\\"dnr\\\"><\\/strong>To build on this legacy, Tilganga is planning a major expansion to Hetauda. This new facility will&nbsp;increase production capacity and introduce premium lens types to serve a broader international market while maintaining the focus on affordability for low-income populations.<\\/p>\\r\\n<p>Operating as a profit not distributing industry, the expanded lab will reinvest earnings to sustain and enhance its humanitarian mission. Key goals of the planned Hetauda IOL facility include:<\\/p>\\r\\n<ul type=\\\"disc\\\">\\r\\n<li>Doubling production capacity to meet the increasing global demand for IOLs.<\\/li>\\r\\n<li>Introducing premium lenses, creating opportunities for financial sustainability and competitive participation in international markets.<\\/li>\\r\\n<li>Generating employment opportunities and contributing to the local economy in Hetauda.<\\/li>\\r\\n<li>Positioning&nbsp;<span class=\\\"xn-location\\\">Nepal<\\/span>&nbsp;as a global leader in eye care innovation.<\\/li>\\r\\n<\\/ul>\\r\\n<p>While Tilganga has been able to source the land required to build the facility, the project&nbsp;requires an estimated investment of approximately&nbsp;<span class=\\\"xn-money\\\">USD 5.2 million<\\/span>&nbsp;to build and operationalize the facility.<\\/p>\\r\\n<p>Today, more than 6.5 million individuals have been cured of blindness owing to Tilganga\'s IOL lab. The planned expansion in Hetauda is an opportunity to amplify this impact, ensuring that&nbsp;no one remains blind because of the high cost of care, while elevating&nbsp;<span class=\\\"xn-location\\\">Nepal<\\/span>&nbsp;as a global leader&nbsp;in eye innovation. The success of this plant will position&nbsp;<span class=\\\"xn-location\\\">Nepal<\\/span>&nbsp;on the international stage for the&nbsp;manufacturing of high-precision devices with reproducible results.<\\/p>\\r\\n<p><strong>MEDIA CONTACTS<\\/strong><\\/p>\\r\\n<p><span class=\\\"xn-person\\\">Lelin Kandel<\\/span><br class=\\\"dnr\\\"><a href=\\\"mailto:lelink@thamel.us\\\" target=\\\"_blank\\\" rel=\\\"nofollow noopener\\\">lelink@thamel.us<\\/a><br class=\\\"dnr\\\">858-371-1593<\\/p>\\r\\n<p>Phillip&nbsp;Sontag<br class=\\\"dnr\\\"><a href=\\\"mailto:phillip@bleucooper.com\\\" target=\\\"_blank\\\" rel=\\\"nofollow noopener\\\">phillip@bleucooper.com<\\/a><br class=\\\"dnr\\\">917-446-4123<\\/p>\\r\\n<p>SOURCE Tilganga Institute of Ophthalmology<\\/p>\\r\\n<p class=\\\"\\\" data-start=\\\"1682\\\" data-end=\\\"1705\\\">\\ud83c\\udf0d&nbsp;<strong data-start=\\\"1900\\\" data-end=\\\"1914\\\">Organizer:<\\/strong>&nbsp;HCP Cureblindness<\\/p>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<p class=\\\"\\\" data-start=\\\"1897\\\" data-end=\\\"2065\\\">\\ud83d\\udcde Contact: (802) 985-3500<br data-start=\\\"1961\\\" data-end=\\\"1964\\\">\\ud83d\\udce7 Email:&nbsp;<a class=\\\"cursor-pointer\\\" rel=\\\"noopener\\\" data-start=\\\"1974\\\" data-end=\\\"1996\\\">info@cureblindness.org<\\/a><br data-start=\\\"1996\\\" data-end=\\\"1999\\\">\\ud83d\\udd17 Website:&nbsp;<a class=\\\"\\\" href=\\\"https:\\/\\/cureblindness.org\\/\\\" target=\\\"_new\\\" rel=\\\"noopener\\\" data-start=\\\"2011\\\" data-end=\\\"2065\\\">https:\\/\\/cureblindness.org<\\/a><\\/p>\\r\\n<p class=\\\"\\\" data-start=\\\"2067\\\" data-end=\\\"2165\\\">Let&rsquo;s come together to honor a Nepali global hero and his mission to make sight accessible to all!<\\/p>\"}','events','charity',NULL,'changing-lives-through-sight--dr-sanduk-ruit-us-tour-2025-share',1,'2025-05-15 19:21:50',0,NULL,0,18,'website_home_category_section',1,'{\"id\":\"cs_live_a19q7XExHWJnKAPjqDvncSDCEaHcaNJ4kZBd72Cf3AyglPArmJVMrPBcFI\",\"object\":\"checkout.session\",\"adaptive_pricing\":{\"enabled\":true},\"after_expiration\":null,\"allow_promotion_codes\":null,\"amount_subtotal\":63,\"amount_total\":63,\"automatic_tax\":{\"enabled\":true,\"liability\":{\"type\":\"self\"},\"provider\":\"stripe\",\"status\":\"complete\"},\"billing_address_collection\":null,\"cancel_url\":\"https:\\/\\/nepstate.com\\/classified_payment_cancel?pid=208&&ad-ids=48,49,50,51\",\"client_reference_id\":null,\"client_secret\":null,\"collected_information\":null,\"co