n<ul class=\\\"list-node\\\">\\r\\n<li>\\r\\n<p class=\\\"text-node\\\"><strong>Mahesh Kafle<\\/strong>&nbsp;&ndash; Known for his powerful vocals and hit tracks that have won hearts across Nepal.<\\/p>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p class=\\\"text-node\\\"><strong>Ashmita Adhikari<\\/strong>&nbsp;&ndash; The voice of a new generation, blending traditional melodies with contemporary flair.<\\/p>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<p class=\\\"text-node\\\"><strong>\\ud83c\\udf89 What to Expect:<\\/strong><\\/p>\\r\\n<ul class=\\\"list-node\\\">\\r\\n<li>\\r\\n<p class=\\\"text-node\\\">Live performances of their biggest hits<\\/p>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p class=\\\"text-node\\\">Traditional and contemporary Nepali musical fusion<\\/p>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p class=\\\"text-node\\\">Cultural celebration with music lovers from all around the U.S.<\\/p>\\r\\n<\\/li>\\r\\n<li>\\r\\n<p class=\\\"text-node\\\">Meet &amp; Greet opportunities in select cities!<\\/p>\\r\\n<\\/li>\\r\\n<\\/ul>\\r\\n<p class=\\\"text-node\\\">Don\'t miss this chance to witness Nepal\'s musical magic on stage. Whether you\'re a longtime fan or new to their music, this is an event that will leave you singing and dancing all night long.<\\/p>\"}','events','concert-music',NULL,'soulful-usa-yatra',1,'2025-08-29 20:46:33',0,NULL,0,19,NULL,1,'','2025-09-28',0.00,'40.2638693','-76.6880329','Hummelstown','Pennsylvania','17036','United States',1,NULL,9,'completed',NULL),
