(60,157,'Yak The Kathmandu Kitchen','{\"is_free_plan\":\"0\",\"category\":\"services\",\"subcategory\":\"restaurant-catering\",\"other_cat\":\"Restaurant\",\"title\":\"Yak The Kathmandu Kitchen\",\"business_name\":\"Yak The Kathmandu Kitchen\",\"address\":\"28600 US Highway 98 suite d, Daphne, AL, USA\",\"latitude\":\"30.6418183\",\"longitude\":\"-87.9116039\",\"city\":\"Daphne\",\"state\":\"Alabama\",\"zip_code\":\"36526\",\"country\":\"United States\",\"contact_name\":\"Salam Singh Lama\",\"contact_email\":\"thekathmandukitchen@gmail.com\",\"contact_number\":\"(251)-264-2046\",\"business_website\":\"http:\\/\\/thekathmandukitchen.com\\/\",\"service_name\":\"Yak The Kathmandu Kitchen\",\"tags\":\"\",\"service_tags\":\"YakTheKathmanduKitchen,NepaliFood,HimalayanCuisine,AuthenticNepaliFood,FoodieNepal\",\"service_category\":\"Yak The Kathmandu Kitchen\",\"year_in_business\":\"1\",\"work_hours\":[\"Monday\",\"Tuesday\",\"Thursday\",\"Friday\",\"Saturday\",\"Sunday\"],\"description\":\"<p>The Kathmandu Kitchen is an authentic Nepali and Indian restaurant located in Daphne, Alabama, offering a unique blend of traditional Himalayan and Indian flavors. Known for its warm hospitality, flavorful curries, aromatic spices, and freshly prepared dishes, the restaurant provides both indoor and outdoor seating with convenient in-store pickup options. With over 230 positive reviews and an 88% recommendation rate, The Kathmandu Kitchen has become a local favorite for those seeking a genuine taste of Nepal and India in the heart of Alabama.<\\/p>\"}','services','restaurant-catering',NULL,'restaurant-2',1,'2025-09-27 01:36:29',0,NULL,0,19,NULL,1,'','2025-10-25',0.00,'30.6418183','-87.9116039','Daphne','Alabama','36526','United States',1,NULL,13,'completed',NULL),
(61,159,'Yummefy Birmingham','{\"is_free_plan\":\"0\",\"category\":\"services\",\"subcategory\":\"restaurant-catering\",\"other_cat\":\"\",\"title\":\"Yummefy Birmingham\",\"business_name\":\"Yummefy Birmingham\",\"address\":\"707 Richard Arrington Junior Boulevard South suite 104, Birmingham, AL, USA\",\"latitude\":\"33.5064812\",\"longitude\":\"-86.7981949\",\"city\":\"Birmingham\",\"state\":\"Alabama\",\"zip_code\":\"35233\",\"country\":\"United States\",\"contact_name\":\"Sam and Rose Pokhrel\",\"contact_email\":\"mailtoyummefy@gmail.com\",\"contact_number\":\"(205)-324-4873\",\"business_website\":\"http:\\/\\/yummefybirmingham.com\\/\",\"service_name\":\"Yummefy Birmingham\",\"tags\":\"\",\"service_tags\":\"YummefyBirmingham,YummefyUK,BirminghamFood,BirminghamEats,AsianCuisine\",\"service_category\":\"Yummefy Birmingham\",\"year_in_business\":\"6\",\"work_hours\":[\"Monday\",\"Tuesday\",\"Wednesday\",\"Thursday\",\"Friday\",\"Saturday\",\"Sunday\"],\"description\":\"<p>Yummefy Birmingham is an Asian Fusion restaurant located in the heart of Birmingham, Alabama. Drawing inspiration from diverse Asian culinary traditions, the restaurant&rsquo;s cuisine blends flavors from Nepal, India, and beyond, offering guests a unique dining experience. With its welcoming atmosphere, both dine-in and outdoor seating options, and a creative menu that celebrates authentic spices and modern twists, Yummefy has become a go-to spot for those seeking flavorful, high-quality Asian fusion dishes in Birmingham.<\\/p>\"}','services','restaurant-catering',NULL,'yummefy-birmingham',1,'2025-09-27 01:02:09',0,NULL,0,19,NULL,1,'','2025-10-25',0.00,'33.5064812','-86.7981949','Birmingham','Alabama','35233','United States',1,NULL,5,'completed',NULL),
(62,161,'Yala Avenue','{\"is_free_plan\":\"0\",\"category\":\"services\",\"subcategory\":\"others\",\"other_cat\":\"Retail \\u2013 Jewelry, Home D\\u00e9cor & Accessories\",\"title\":\"Yala Avenue\",\"business_name\":\"Yala Anenue\",\"address\":\"100 Jefferson St N suite 127, Huntsville, Alabama 35801, USA\",\"latitude\":\"34.7315712\",\"longitude\":\"-86.5863687\",\"city\":\"Huntsville\",\"state\":\"Alabama\",\"zip_code\":\"35801\",\"country\":\"United States\",\"contact_name\":\"Suzana Richardson\",\"contact_email\":\"hello@yalaavenue.com\",\"contact_number\":\"(256)-384-3301\",\"business_website\":\"\",\"service_name\":\"Yala Anenue\",\"tags\":\"\",\"service_tags\":\"YalaAvenue,HuntsvilleShopping,ClintonRowShops,HuntsvilleBoutique,NepaliJewelry\",\"service_category\":\"Yala Anenue\",\"year_in_business\":\"3\",\"work_hours\":[\"Tuesday\",\"Wednesday\",\"Thursday\",\"Friday\",\"Saturday\"],\"description\":\"<p>Yala Avenue is a specialty retail boutique located in the Clinton Row Shops of Downtown Huntsville, Alabama. Founded by Suzana Richardson, the store celebrates Nepali heritage through thoughtfully designed jewelry, stylish home d&eacute;cor, and meaningful cultural accessories. Every piece reflects a fusion of traditional Himalayan craftsmanship and contemporary fashion, making Yala Avenue the go-to destination for unique gifts, ethical fashion, and global-inspired living. Whether you&rsquo;re shopping for handcrafted jewelry, distinctive home accents, or cultural treasures, Yala Avenue offers a shopping experience that connects art, culture, and community.<\\/p>\"}','services','others',NULL,'yala-avenue',1,'2025-09-27 00:53:16',0,NULL,0,19,NULL,1,'','2025-10-26',0.00,'34.7315712','-86.5863687','Huntsville','Alabama','35801','United States',1,NULL,11,'completed',NULL),
(63,162,'Himalayan Nepali Cuisine','{\"is_free_plan\":\"0\",\"category\":\"services\",\"subcategory\":\"restaurant-catering\",\"other_cat\":\"\",\"title\":\"Himalayan Nepali Cuisine\",\"business_name\":\"Himalayan Nepali Cuisine\",\"address\":\"312 Schillinger Road South suite c, Mobile, AL, USA\",\"latitude\":\"30.685413\",\"longitude\":\"-88.22740429999999\",\"city\":\"Mobile\",\"state\":\"Alabama\",\"zip_code\":\"36608\",\"country\":\"United States\",\"contact_name\":\"Manager\",\"contact_email\":\"himalayancuisinemobile@gmail.com\",\"contact_number\":\"(251)-725-0904\",\"business_website\":\"https:\\/\\/www.namastenepalirestaurant.net\\/\",\"service_name\":\"Restaurant\",\"tags\":\"\",\"service_tags\":\"NepaliFood,TasteOfNepal,AuthenticNepaliFood,NamasteNepaliRestaurant\",\"service_category\":\"Himalayan Nepali Cuisine\",\"year_in_business\":\"2\",\"work_hours\":[\"open 24\\/7\"],\"description\":\"<p>Himalayan Nepali Cuisine in Mobile, Alabama, brings the rich and authentic flavors of Nepal and India to your table. From savory momo dumplings and aromatic curries to sizzling tandoori specialties, every dish is crafted with passion and traditional Himalayan spices. The restaurant offers a diverse menu that reflects the culinary heritage of the Himalayas, making it a perfect spot for both lunch and dinner. With its warm hospitality and flavorful dishes, Himalayan Nepali Cuisine promises a dining experience that transports you straight to the heart of Nepal and India.<\\/p>\"}','services','restaurant-catering',NULL,'himalayan-nepali-cuisine',1,'2025-09-27 00:25:31',0,NULL,0,19,NULL,1,'','2025-10-26',0.00,'30.685413','-88.22740429999999','Mobile','Alabama','36608','United States',1,NULL,24,'completed',NULL),
(64,163,'Namaste Shangri-La','{\"is_free_plan\":\"1\",\"category\":\"services\",\"subcategory\":\"restaurant-catering\",\"other_cat\":\"\",\"title\":\"Namaste Shangri-La\",\"business_name\":\"Namaste Shangri-La\",\"address\":\"2446 E Tudor Rd, Anchorage, Alaska 99507, USA\",\"latitude\":\"61.1801752\",\"longitude\":\"-149.8357466\",\"city\":\"Anchorage\",\"state\":\"Alaska\",\"zip_code\":\"99507\",\"country\":\"United States\",\"contact_name\":\"Tsering Lama\",\"contact_email\":\"namasteshangrila@gmail.com\",\"contact_number\":\"(907)-569-3000\",\"business_website\":\"https:\\/\\/namasteshangrila.com\\/\",\"service_name\":\"Restaurant\",\"tags\":\"\",\"service_tags\":\"NamasteShangriLa,NepaleseFood,IndianFood,AuthenticFlavors,AlaskaEats\",\"service_category\":\"Namaste Shangri-La\",\"year_in_business\":\"17\",\"work_hours\":[\"Monday\",\"Tuesday\",\"Wednesday\",\"Thursday\",\"Friday\",\"Saturday\",\"Sunday\"],\"description\":\"<p data-start=\\\"736\\\" data-end=\\\"1187\\\">Namaste Shangri-La is a Nepalese &amp; Indian restaurant and catering service in Anchorage, Alaska, offering authentic Himalayan flavors with warm hospitality. Located at 2446 E Tudor Rd, the restaurant blends traditional Nepalese and Indian recipes using the freshest ingredients and authentic spices. With a newly refurbished dining space and free WiFi, it&rsquo;s an ideal spot for family dinners, business lunches, or casual gatherings.<\\/p>\\r\\n<p data-start=\\\"1189\\\" data-end=\\\"1531\\\">The menu features healthy, flavorful dishes inspired by Nepalese, Indian, Tibetan, and Burmese cuisines, including vegetarian options, lean meats, momo dumplings, curries, pickles, and chutneys. Known for generous portions, flawless presentation, and a cozy Nepalese ambiance, Namaste Shangri-La delivers a true taste of Nepal in Anchorage.<\\/p>\\r\\n<p data-start=\\\"1533\\\" data-end=\\\"1724\\\">With affordable prices and authentic home-style cooking, the restaurant has become a local favorite and an award-winning destination for those seeking a genuine Himalayan dining experience.<\\/p>\",\"plan\":\"19\",\"coupon_code\":\"\",\"plan_amount\":\"0\",\"sub_plan_amount\":\"0\",\"is_coupon_apply\":\"0\"}','services','restaurant-catering',NULL,'namaste-shangrila',1,'2025-09-27 01:18:46',0,NULL,0,19,NULL,1,'','2025-10-27',0.00,'61.1801752','-149.8357466','Anchorage','Alaska','99507','United States',1,NULL,5,'completed',NULL),
(65,164,'Beni Ko Bazar','{\"is_free_plan\":\"1\",\"category\":\"services\",\"subcategory\":\"others\",\"other_cat\":\"Grocery Store\",\"title\":\"Beni Ko Bazar\",\"business_name\":\"Beni Ko Bazar\",\"address\":\"11831 North 19th Avenue, Phoenix, AZ, USA\",\"latitude\":\"33.5940546\",\"longitude\":\"-112.0991372\",\"city\":\"Phoenix\",\"state\":\"Arizona\",\"zip_code\":\"85029\",\"country\":\"United States\",\"contact_name\":\"Unknown\",\"contact_email\":\"benikobazarllc@gmail.com\",\"contact_number\":\"(602)-380-4743\",\"business_website\":\"https:\\/\\/benikobazar.com\\/\",\"service_name\":\"Grocery Store\",\"tags\":\"\",\"service_tags\":\"BeniKoBazar,NepaliGrocery,NepaliSpices,TasteOfNepal,AsianGroceryPhoenix\",\"service_category\":\"Beni Ko Bazar\",\"year_in_business\":\"1\",\"work_hours\":[\"open 24\\/7\"],\"description\":\"<p>Beni Ko Bazar is a grocery store in Phoenix, Arizona, dedicated to bringing authentic products from Nepal, India, and neighboring regions to the local community. The store offers a variety of unique and packaged items imported directly from South Asia, catering to diverse tastes and cultural needs. Known for its friendly atmosphere and welcoming service, Beni Ko Bazar greets every customer with warmth and a smile, making it a go-to destination for South Asian groceries in Phoenix.<\\/p>\",\"plan\":\"19\",\"coupon_code\":\"\",\"plan_amount\":\"0\",\"sub_plan_amount\":\"0\",\"is_coupon_apply\":\"0\"}','services','others',NULL,'beni-ko-bazar',1,'2025-09-27 02:08:13',0,NULL,0,19,NULL,1,'','2025-10-27',0.00,'33.5940546','-112.0991372','Phoenix','Arizona','85029','United States',1,NULL,0,'completed',NULL);
