(1,'Nepstates','https://admin.nepstate.com/images/logo/1739511638.png','1714029348.jpg','<h3><strong>Confession Rules</strong></h3>\r\n<p><strong>Rule 1:</strong> Do not include personally identifiable information (e.g., names, addresses, or contact details).</p>\r\n<p><strong>Rule 2:</strong> Be respectful. Do not use offensive, hateful, or discriminatory language.</p>\r\n<p><strong>Rule 3:</strong> Confessions must not contain content related to illegal activities, explicit material, or harm to oneself or others.</p>\r\n<p><strong>Rule 4:</strong> Do not post false claims, rumors, or fabricated stories.</p>\r\n<p><strong>Rule 5:</strong> Tag sensitive or triggering topics appropriately (e.g., &ldquo;TW: Anxiety&rdquo;).</p>\r\n<p><strong>Rule 6:</strong> Confessions are subject to moderation and may be edited or removed if they violate these rules.</p>\r\n<p><strong>Rule 7:</strong> No spam or promotional content is allowed.</p>\r\n<p><strong>Rule 8:</strong> Post one confession at a time to maintain clarity and fairness.<br><br></p>\r\n<h3><strong>Disclaimer for User Accountability</strong></h3>\r\n<p><br><em>\"NepState is a platform for user-generated content and interactions. NepState is not liable for any user-generated content, including opinions, posts, comments, or transactions. Users are solely responsible for ensuring that their activities and content comply with local, national, and international laws and regulations. Any violations are the sole responsibility of the individual user.\"</em></p>','<h3><strong>Forum Rules</strong></h3>\r\n<p><strong>Rule 1:</strong> Be respectful to all members. Personal attacks, harassment, or hate speech will not be tolerated.</p>\r\n<p><strong>Rule 2:</strong> Post relevant content in the appropriate category. Use clear titles and avoid duplicate or spam posts.</p>\r\n<p><strong>Rule 3:</strong> Tag sensitive or NSFW content appropriately and ensure it complies with forum guidelines.</p>\r\n<p><strong>Rule 4:</strong> Respect the privacy of others. Do not share personal or confidential information without permission.</p>\r\n<p><strong>Rule 5:</strong> Do not share illegal, copyrighted, or misleading content. Always cite sources for factual posts.</p>\r\n<p><strong>Rule 6:</strong> Follow moderator instructions. Report rule violations instead of engaging directly.</p>\r\n<p><strong>Rule 7:</strong> Misconduct or rule violations may lead to warnings, suspension, or permanent bans.<br><br></p>\r\n<h3><strong> Disclaimer for User Accountability</strong></h3>\r\n<p><br><em>\"NepState is a platform for user-generated content and interactions. NepState is not liable for any user-generated content, including opinions, posts, comments, or transactions. Users are solely responsible for ensuring that their activities and content comply with local, national, and international laws and regulations. Any violations are the sole responsibility of the individual user.\"</em></p>','<ol>\r\n<li>Explore a world of diverse opportunities on our comprehensive listing platform</li>\r\n<li>&nbsp;From upcoming events, diverse job opportunities, and specialized services to top-tier IT training programs, ideal roommates, and rental spaces &mdash; find what you need.</li>\r\n<li>Immerse yourself in insightful blogs and engage in lively discussions, confessions, and community forums.</li>\r\n<li>Elevate your business by promoting your services and reaching a broader audience.</li>\r\n<li>Other businesses can also showcase their offerings in our dedicated AD section. Stay updated with the latest additions in each category.</li>\r\n<li>Your comprehensive experience begins here, connecting you to opportunities and a thriving community.</li>\r\n</ol>','+240-558-6657','info@nepstate.com','© 2024 NepStates','https://www.twitter.com/','https://pin.it/3IgJP0jrc','https://www.instagram.com/nepstate_us/','https://www.facebook.com/profile.php?id=61571765323490','https://www.linkedin.com','','https://www.skype.com','Nepst